      'summary' => '查询指定资源的配置时间线。配置审计记录资源的每一次配置变更和资源关系变更，并整理为配置时间线。您开通配置审计服务后，配置审计开始记录资源的配置变更和资源关系变更历史，并默认保存10年。',
      'description' => '配置审计为您提供每个监控范围内资源的配置时间线，具体如下：

